import React, { useState, useEffect } from "react";
import './Review.css';
import data from "./review-tables/data";
import { FaPowerOff } from "react-icons/fa";



function Review() {

    const [foodState, setFoodState] = useState();

    const onChangeComboBox = (e) => {
      const selectedId = e.target.value;
      const selectedFoodState = data.filter((d) => d.id == selectedId)[0];
      setFoodState(selectedFoodState);
    };

    useEffect(() => {
      setFoodState(data[1]);
    }, []);

    <select
        className="custom-select"
        value={foodState?.id}
        onChange={(e) => {
          onChangeComboBox(e);
        }}
      >
        {data.map((d) => (
          <option key={d.id} value={d.id}>
            {d.box}
          </option>
        ))}
      </select>

return (



	<div className="App">

<select
    className="custom-select"
    value={foodState?.id}
    onChange={(e) => {
      onChangeComboBox(e);
    }}
  >
    {data.map((d) => (
      <option key={d.id} value={d.id}>
        {d.box}
      </option>
    ))}
  </select>

            <h1>Review Old Application</h1>
            <h2>Logout</h2>
            <h3btn><FaPowerOff/></h3btn>


	<table class="Review">
        <thead>
            <tr>
                <th class="header">S.NO</th>
